', 'name': 'WG-Engine', 'color': '5319e7', 'default': False, 'description': 'core PowerShell engine, interpreter, and runtime'}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 6, 'created_at': '2017-02-08T00:21:38Z', 'updated_at': '2022-04-05T21:31:50Z', 'closed_at': None, 'author_association': 'CONTRIBUTOR', 'active_lock_reason': None, 'body': "When running PSCommands which contain AddScript calls through Debugger.ProcessCommand, the scripts in those commands are always added to the user's command history.  Any host that relies on Get-History to retrieve the command history will end up with items which the user didn't personally execute in the debugger.  It'd be nice if there was a ProcessCommand overload (or some other way) to indicate that the executed command shouldn't be added to the command history.

