', 'active_lock_reason': None, 'body': 'Right now, it seems the azure/login@v1 step applies the context to all console application sessions. It doesn't seem like there is any scope option like the below:

https://docs.microsoft.com/en-us/powershell/azure/context-persistence?view=azps-7.1.0#save-azure-contexts-across-powershell-sessions

Would be useful to have a feature such as a "scope:" property that limits the context to the process, so it doesn't affect another process connecting to a different environment, e.g., a user might have an Azure Stack environment and an Azure Cloud environment. The user might fetch common credentials from Azure Cloud and then switch to Azure Stack environment to use them. This context change will break similar parallel code execution if it is across all applications.', 'reactions': {'url': 'https://api.github.com/repos/Azure/login/issues/202/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/Azure/login/issues/202/timeline', 'performed_via_github_app': None}}
